def string_xor(a: str, b: str) -> str:
    # Input validation: Ensure input strings a and b consist only of 1s and 0s
    if not set(a).issubset({'0', '1'}) or not set(b).issubset({'0', '1'}):
        raise ValueError("Input strings must consist only of 1s and 0s")

    # Check if the lengths of the input strings are equal
    if len(a) != len(b):
        raise ValueError("Input strings must be of the same length")

    # Perform binary XOR operation on the input strings
    result = ''.join(str(int(x) ^ int(y)) for x, y in zip(a, b))

    return result

