def rescale_to_unit(numbers: List[float]) -> List[float]:
    min_val = min(numbers)
    max_val = max(numbers)

    if max_val == min_val:
        return [0.0] * len(numbers)

    scaled_numbers = [(num - min_val) / (max_val - min_val) for num in numbers]

    return scaled_numbers

