    Compute the n-th element of the FibFib number sequence.

    Args:
    n (int): The index of the desired element in the sequence.

    Returns:
    int: The n-th element of the FibFib number sequence.
    """
    # Create a dictionary to store previously computed values
    memo = {0: 0, 1: 0, 2: 1}

    def fibfib_helper(k: int) -> int:
        # If the value is already computed, return it
        if k in memo:
            return memo[k]
        # Otherwise, compute the value and store it in the memo dictionary
        else:
            result = fibfib_helper(k - 1) + fibfib_helper(k - 2) + fibfib_helper(k - 3)
            memo[k] = result
            return result

    return fibfib_helper(n)

