def histogram(test):
    # Parse the input string into individual lowercase letters
    letters = test.split()

    # Count the occurrence of each letter
    letter_counts = {}
    for letter in letters:
        if letter in letter_counts:
            letter_counts[letter] += 1
        else:
            letter_counts[letter] = 1

    # Identify the maximum occurrence count
    max_count = max(letter_counts.values(), default=0)

    # Return a dictionary containing all letters with the maximum occurrence count
    result = {letter: count for letter, count in letter_counts.items() if count == max_count}
    return result

